import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Temperature from './Temperature';
import Humidity from './Humidity';

const useStyles = makeStyles({
  root: {
    minWidth: 400,
    marginBottom: 25
  },
});

interface CardTHProps {
  typeData: "Temperature" | "Humidite";
  value: number;
}

function CardTH(props: CardTHProps) {
    const classes = useStyles();
    const { typeData, value } = props;
    const data = () => {
      if(typeData === "Temperature"){
        return <Temperature title="Température intérieure" value={value}/>;
      } else if(typeData === "Humidite") {
        return <Humidity title="Humidité intérieure" value={value}/>;
      }
    }
    return (
        <Card className={classes.root}>
            <CardContent>
                {data()}
            </CardContent>
        </Card>
    );
}

export default CardTH;
